style.css:
@-moz-document domain("vranimesociety.com")
{
html
{
  background-color: #2C2F33;
}

.brand
{
  color: #dddddd !important;
}

.el-card__body
{
  background-color: #3D4044;
  border-color: #bbbbbb;
}

.el-button:not(.el-button--danger):not(.el-button--warning):not(.el-button--success)
{
  background-color: #bbbbbb;
}

.date-time
{
  color: #dddddd;
}

.el-switch__label
{
  color: #999999;
}

.el-dropdown-menu
{
  background-color: #3D4044;
}

.el-dropdown-menu__item
{
  color: #eeeeee !important;
}

.el-dropdown-menu__item > a
{
  color: #eeeeee !important;
}

.el-dropdown-menu__item:hover
{
  background-color: #aaaaaa !important;
}

.text-regular
{
  color: #dddddd !important;
}
}
